(30, 54, '11/12/2017', 'Dr Deborah Lee', '65yo presenting with hip pain + exertion dyspnoea\r\n\r\nBackground:\r\ni. Farmer\r\nii. Non-smoker; minimal ethoh\r\niii. PTB - Diagnosed in 1999; last CXR ?5 years ago; completed course 6/12 treatment early this year; nil recent symptoms\r\niv. No known HTN/ HChol/ T2DM/ CAD\r\nv. Allergies -Nil\r\n\r\nIssues:\r\n1) Hip pain\r\n- c/o right hip pain, dull in nature and occasionally radiating down posterior thigh\r\n- Worse at the end of the day/ after work\r\n- Nil distal neuropathy/ bowel or bladder symptoms/ recent trauma\r\n- Takes Paracetamol to some relief\r\n2) Exertional dyspnoea\r\n- c/o SOB when working\r\n- Able to mobilize ~20-30min/ 5km before getting SOB\r\n- Nil cough/ palpitations/ angina\r\n3) Varicose veins\r\n- Concerned about superficial venous enlargement\r\n- Nil associated symptoms\r\n4) PTB\r\n- Last flare 2009 -> fevers , LOW, dyspnoea\r\n- Nil recent symptoms/ fevers/ haemoptysis\r\n\r\nO/E:\r\n- CVS -> HS I + II \r\n- Respi -> Significantly reduced aeration bilaterally, right > left\r\n- MSK -> Mild tenderness on palpation over right hip; straight leg raise negative; nil peripheral neuropathy\r\n- Varicose veins', '1) OA of right hip with referred gluteal/ thigh pain\r\n2) Latent PTB\r\n3) Dyspnoea on ++++ exertion (normal), low risk for CAD\r\n4) Varicose veins, occupational related', '', '', '12.4', '5.5mmol/L', '', 0),
