(193, 250, '12/12/2017', 'Dr Lawrence Ng', '1. Headache & Neck pain - 3 yr.  factory worker\r\n- sweating\r\n- no neuro deficits in UL\r\n- frontal heartache\r\n- BOV when dizzy. No diplopia.\r\n\r\n2. Low back pain\r\n- PU/ BO - no loss of control\r\n- no sciatica\r\n\r\n3. Vaginal discharge\r\n\r\n4. Bloody urine with dysuria\r\n\r\n5. Hypt - on meds\r\n- no money for meds\r\n\r\nEx: ', '1. OA neck and spine\r\n2. UTI\r\n3. HYPT\r\n4. Vaginal discharge', 'Cardiovascular,Gynaecology,Musculo-skeletal,Urology', 'WBC + RBC ++ Prot - Glu -', '', '', 'Women clinic', 0),
(194, 236, '12/12/2017', 'Dr Anu Pandey', '36 years old female\r\nDiabetes diagnosed 1 year ago, currently on medication, compliant, but has missed medications for the past 2 days\r\nWorks at the factory \r\n\r\nPresenting complaint\r\n1. Epigastric pain\r\n- onset since 1 year ago\r\n- worse on eating, feels nauseous \r\n- pain occurs immediately after eating\r\n- no malena or blood in stools \r\n- no radiation of pain to the RHC \r\n- no jaundice or scleral icterus \r\n- pain occurs daily \r\n\r\n2. ? LOC \r\n- patient claims that she would have episodes of syncope, about once a month\r\n- usually associated with tremors, palpitations, sweating (symptoms of hypoglycaemia) \r\n- no blood glucose monitoring at home\r\n- these episodes usually occur at the factory, usually when she has not had anything to eat \r\n\r\nPU, BO normal\r\nNo LOW, but experiences anorexia with epigastric pain\r\nMenstrual history unremarkable \r\n\r\nNo smoke or alcohol exposure \r\nHistory not clear regarding long term NSAID use \r\nMother with gastric cancer - diagnosed at 56 years old (no surgery, just took medications)\r\n\r\nPhysical examination\r\n\r\n', '1. Diabetes - with possible episodes of hypoglycaemia \r\n2. Epigastric pain, to rule out gastric ulcer', '', '', '', '', '1. Gastroenterology ', 1),
