(291, 346, '12/12/2017', 'Dr Lawrence Ng', '1. Neck pain & backache & headache - 3 mth\r\n\r\n2. Blur vision - 3 y\r\n\r\n3. Constipation\r\n- 1 y\r\n- relieved by meds\r\n- no loss of wt\r\n\r\n4. Gastritis\r\n\r\nEX:\r\nNeck & LS spine: NAD\r\nEyes - NAD\r\nMentally stable', '1. Constipation\r\n2. Gastritis\r\n3. Blur vision\r\n4. Anxiety and insomnia\r\n5. OA spine\r\n6. Headache', 'Gastrointestinal,Musculo-skeletal,Psychology', '', '', '', 'Refer Sabai vision', 0),
(292, 355, '12/12/2017', 'Dr Gerard Low', '50 years old farmer married 3 children\r\nNo Hx of smoking and alcohol use\r\nRight sided neck pain for 2 weeks \r\nno runny nose \r\nno sorethroat \r\nno cough\r\nno gum/ tooth problem\r\nRight sole pain 2 weeks\r\nMedical history: Unknown\r\nPE:\r\ntender posterior cervical lymph node\r\nPharynx normal\r\nGum tooth normal\r\ntenderness @ plantar flexor origin ', 'Cervical Lymphadenitis\r\nPlantar fasciitis', 'Infectious Diseases,Musculo-skeletal', '', '', '', '', 0),
(293, 358, '12/12/2017', 'Dr Joan Chin', 'housewife..bilateral shoulder pain 5 years,  had fallen  from a tree at 15 years old..\r\nhas headache x 40 years,n generalised headache , pain score  8.  no vomiting,  ? fever daily 40 years\r\nalso c/o gastritis 1 years, wants meds\r\no/e: well, not pale , cranial nerves intact,no nystagmus\r\nno dysmetria, no dysdiadochokinesis. rhomberg neg, tandem gait normal\'. neck rom full and pain free', 'shoulder ache\r\ntension headache\r\ngastritis', '', '', '', '', '', 0),
(294, 370, '12/12/2017', 'Dr Christopher Wee', 'cough with sputum x 1 week\r\nNo running nose\r\nFever\r\nT 38 C\r\nH/L clear', 'URTI', 'Respiratory', '', '', '', '', 0),
(295, 361, '12/12/2017', 'Dr Benjamin Tang', 'right sided sciatic pain. radiates down to big toe\r\nno weakness\r\nsome pain on left but not as bad\r\nno sensory changes\r\nstill walks and has no incontinence\r\nright knee had an accident a few months ago\r\n\r\nblurry vision\r\nwith no glasses she cannot see near and far\r\ncan see near with glasses\r\n\r\ngastric pain for 1 year\r\nburning pain everyday after eating meals\r\n\r\ntriage BP 143/84\r\nmanual BP 120/80, 100/50\r\neye: right no cataract. left- mild corneal haziness\r\nabdo soft. mild epigastric tenderness\r\n', 'gastritis\r\nsciatica\r\nleft cataract?\r\n', 'Eye,Gastrointestinal,Neurology', '', '', '', 'refer PT for back strengthening exercises\r\nrefer Sabai eye', 0),
(296, 363, '12/12/2017', 'Dr Charles Chuah', '55 year old, housewife\r\nSore throat, sensation of obstruction in throat 2-3 months, worse after drinking cold water\r\nDyspnoea\r\n\r\nPMH - hyperlipidaemia, hypocalcaemia (detected from blood test)\r\n\r\no/e\r\nThroat not injected\r\nLungs clear', 'URTI', 'ENT,Respiratory', '', '', '', '', 0),
(297, 366, '12/12/2017', 'Dr Lawrence Ng', '1. Gastric pain - 5 y\r\n- 2 kg over 2 mth\r\n- chest burn\r\n- no vomit blood\r\n- no black stools\r\n- nausea every morning\r\n\r\n2. Low back pain - 3 mth\r\n- no injury\r\n\r\n3. Headache - 5 y', '1. Gastritis\r\n2. Low back pain\r\n3. Headache', 'Gastrointestinal,Musculo-skeletal,Neurology', '', '', '', '', 0),
(298, 364, '12/12/2017', 'Dr Angeline Lim', '1. burning pain reflux for 2 month, on/off, non smoker, irregular meal, vomit once for every two days, \r\n\r\nPE: abdomen tender at mainly epigastrium, no masses palpable, no guarding pain, \r\n', 'gastritis with GERD ', 'Gastrointestinal', '', '', '', '', 0),
(299, 341, '12/12/2017', 'Dr Deborah Lee', '63yo F\r\n\r\nBackground:\r\ni. Farmer; lives with children and grandchildren\r\nii. Non-smoker; nil etoh\r\niii. T2DM - Oral hypoglycaemic TDS; followed up by ?Free health clinic\r\niv. Allergies - Seafood\r\n\r\nIssues:\r\n1) T2DM\r\n- Feels that BSL level is poorly-controlled despite regular medication\r\n- Ophthalmic -> Increased visual blurriness\r\n- Nephropathic -> Polyuria/ nocturne (4x per night); polydipsia\r\n- Neuropathy -> ?increased lower limb peripheral neuropathy/ parasthesia\r\n- GIT -> Dull abdominal ache\r\n- Immune -> Dysuria; vaginal thrush\r\n2) Abdominal pain\r\n- Mild central abdominal pain (chronic)\r\n- Dysuria but no constipation/ diarrhoea/ infective symptoms\r\n\r\nO/E:\r\n- CVS -> HS I + II + nil\r\n- Respi -> Chest clear\r\n- GIT -> Abdo soft; central + suprapubic tenderness on palpation\r\n- Mild lower limb peripheral neuropathy; numbness', '1) VERY POORLY CONTROLLED T2DM with associated complications', '', '2+ glucose\r\nNo ketones', '', '27.5mmol/L', '- Vision (diabetic retinopathy)\r\n- Women\'s clinic\r\n- Chronic disease (very poorly-controlled T2DM with complications)', 1),
(300, 367, '12/12/2017', 'Dr Christopher Wee', 'giddiness x 1 mth\r\nheadache Neckpain\r\nno p/h Hypt\r\nDysuria\r\nBp 128/89\r\nT 37.4C\r\nH/L clear\r\nNo pallor\r\n', 'URTI\r\ngiddiness\r\nmild Hypertension\r\nto do urine dipstix and Hb', 'Cardiovascular,Hematology,Musculo-skeletal', '', '', '', '', 0),
(301, 365, '12/12/2017', 'Dr Regina Tan', 'bilateral calf pain X  6 days\r\n feels pain after walkings about 50m relieved by sitting down , can resume walking after a few minutes restL shoulder pain  on & off 12 years\r\nFROM L Shoulder\r\n SLR 90/90\r\nspine Nad\r\n no tenderness of the calves', 'Calf cramps', 'Musculo-skeletal', '', '', '', '', 0),
(302, 377, '12/12/2017', 'Dr Joan Chin', 'farmer, c/o mass at  r buttock x 4 years, getting bigger , no discharge, no fever.claims no operation done before\r\no/e:: linear scar 12 cm\r\nsoft cystic like mass r buttock 12cm  x 10cm  r buttock, no punctum seen,.no infection seen.', 'r buttock lipoma 12cm x10cm\r\ns/t dr gerard low: cold case, for pat to attend gen surgery soc himself', '', '', '', '', '', 0),
(303, 379, '12/12/2017', 'Dr Lawrence Ng', '(BP noted to be high 154/117)\r\n\r\nTinnitus at night\r\n- sudden onset\r\n- seen by clinic in PP\r\n- diagnosed as inflammation\r\n\r\nOtoscopy - earwax ++. Cant see TM.\r\n', '1. Tinnitus\r\n2. High BP', 'ENT', '', '', '', '1. High BP, not on medication. Refer Chronic care for BP monitoring\r\n2. Refer ENT for tinnitus', 1),
(304, 368, '12/12/2017', 'Dr Gerard Low', '35 years seller (beverage and water)\r\nright shoulder pain radiation to the right upper arm 2 months\r\nno smoking\r\nalcohol use \r\nno trauma or injury is associated \r\nPE\r\nNeck ROM full- but painful at extreme of movement \r\nshoulder ROM full\r\nSuprascapular tenderness', 'Right shoulder pain', 'Musculo-skeletal', '', '', '', '', 0),
