(308, 380, '12/12/2017', 'Dr Deborah Lee', 'Repeat visit today after returning home to get her medications - \r\n\r\nRegular meds:\r\n1) Na Valproate 250mg BD\r\n2) Diazepam 5mg note\r\n3) Betahistine dihydrochloride 8mg TDS\r\n\r\nPlan:\r\n- Advised that above medications unlikely for heart condition, but patient insists that being prescribed for \"cardiomegaly\" and denies any epileptic episodes.\r\n- Advised that we will not be giving her repeat prescription for these, but to continue and visit own specialist for clarification of condition/ medications', 'Likely partial complex/ absence seizures, on AED', '', '', '', '', '', 0),
